import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import logo from '../media/otter.svg';
import withRoot from '../withRoot';

const styles = theme => ({
    headbar: {
        flexGrow: 1,
        backgroundColor: theme.palette.primary.light,
        position: "fixed",
    },
    logo: {
        width: 20,
        height: 20,
    }
});


class HeadBar extends React.Component {

    render() {
        const { classes } = this.props;

        return (
            <div className={ classes.headbar }>
                <AppBar className={ classes.headbar } position="static">
                    <Toolbar variant="dense">
                        <Typography className={ classes.headbar } variant="h6">
                            ASR (Assessment Assistance)
                        </Typography>
                        <img src={ logo } className={ classes.logo } alt="logo" />
                    </Toolbar>
                </AppBar>
            </div>
        )
    }
}

HeadBar.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withRoot(withStyles(styles)(HeadBar));
